import React from "react";
import { NavLink } from "react-router-dom";
import './Statistiques.css';

function Statistiques() {
    return (
        <div className="App">
        <header className="App-header">
            <p>Statistiques</p>
            <NavLink className="nav-link" to="/">Home</NavLink>
        </header>
        </div>
    );
}

export default Statistiques;
